import React from 'react';
import boardService from '../../services/board-service';
import { Link } from 'react-router-dom';

const Card = (props) => {

  const date = props.createdAt.slice(0, 10)

    return(

      <div className="card-item mt-2">
        <Link className="" to="./card" data-target=".bd-card-modal-xl">
            <div className="card-header p-2 bg-secondary">
                <p className="text-light">{props.title}</p> 
            </div>
            <div className="card-body p-2 d-flex justify-content-between text-info bg-white">
                <p className="card-text-panel">{date}</p>

                {props.attachFiles &&
                <p className="card-text-panel"><i className="fas fa-paperclip"></i></p>}
                {props.accountPay && 
                <p className="card-text-panel"><i className="fas fa-euro-sign"></i></p>}
                {props.dateStart &&
                <p className="card-text-panel"><i className="fas fa-calendar"></i></p>}
            </div>
        </Link>
      </div>
    )
}

export default Card;
